    encoded = ''
    for char in message:
        if char.isalpha():
            if char.islower():
                encoded += chr((ord(char) - ord('a') + 2) % 26 + ord('a'))
            else:
                encoded += chr((ord(char) - ord('A') + 2) % 26 + ord('A'))
            if char in vowels:
                encoded += chr((ord(char) - ord('a') + 2) % 26 + ord('a'))
        else:
            encoded += char
    return encoded

