def minPath(grid, k):
    n = len(grid)
    dp = [[float('inf')] * (n + 1) for _ in range(k + 1)]
    dp[0][0] = 0

    for i in range(1, k + 1):
        for j in range(1, n + 1):
            for x in range(1, n + 1):
                if x != j and grid[i - 1][x - 1] != grid[i - 1][j - 1]:
                    dp[i][j] = min(dp[i][j], dp[i - 1][x] + grid[i - 1][j - 1])

    return [grid[i - 1][j - 1] for i in range(1, k + 1) for j in range(1, n + 1) if dp[i][j] == dp[k][n]]

